import { getByLabelText } from "@testing-library/react"
import Car from "./Car"
function LanBoJen(props) {


    var arr = Array.of(1,2,3,4,5)
    return (
    <>
    <h2> my lanbojen's color is {props.color} Car!</h2>

    <ul>
    {
   
   arr.map((item ,index) => {
        return <li>{item * 2}</li>
    })





}
    </ul>


    <Car/>
    </>

    )

}
export default LanBoJen
